allegation_s:
Failure to document specific purpose and mileage of campaign automobile expenses
(SF C&GCC § 1.106; Cal Gov. Code § 89516(d)(2)); Use of campaign funds for purposes not reasonably related to a legislative, governmental or political purpose
(SF C&GCC § 1.122(b)(i); Cal Gov. Code §§ 89510(b), 89512);
